import React from 'react';
import './HomePage.css';

const Home = () => {
    return (
        <div className="home">
            <div className="banner">
                <img className="banner2" src="images/banner.jpg" alt="image" />

            </div>
            <div>
                <h2>--------------Buy your Favourites ----------</h2>
                <img className="breakfast" src="images/breakfast_pc.jpg" alt="image" />
            </div>
            <div>
                <img className="breakfast-child" src="images/breakfast_pc.jpg" alt="image" />

            </div>

        </div>
    );
};
export default Home;
